          localStorage.setItem('case', JSON.stringify(data));
          window.location.href = '/CaseSelector';
        }
        else 
        {
         console.log(response) 
        }
      } catch (error) {
        console.log(error);
      }
    };
    const sendPSUData = async (event) => {
      try {
        const response = await fetch('http://localhost:4000/api/auth/powersupplyget', {
          method: "GET", 
