 <a href="/products/internal-hard-drive/">
Storage
</a>
</td>
<td>{storageName}</td>
                <td>{storagePrice}</td>
                <td>{storageWhere}</td>
<Link onClick={sendStorageData}>
  <a href="/StorageSelector" className="button button--icon button--small">
