</a>
</td>
<td>{psuName}</td>
                <td>{psuPrice}</td>
                <td>{psuWhere}</td>
<Link onClick={sendPSUData}>
  <a href="/PowerSupplySelector" className="button button--icon button--small">
    Choose A Power Supply
  </a>
</Link>
</tr>
</tbody>
                    </table>
                </div>
            </div>
        </div>
    )
}

export default Partpicker;
